import React from "react";
import diceImage from "../images/dice-eyes-luck-game-705171.webp"; // Import the image

const StartGame = () => {
  return (
    <div>
      <div className="soso">
        <img src={diceImage} alt="dice image" />
        <div>
        <h1>StartGame</h1>
        <button>Play Now</button></div>
      </div>
    </div>
  );
};

export default StartGame;
